import React, {useState, useEffect} from 'react';
import axios from 'axios';
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';
import Footer from '../components/Footer';

const Profile = ({ userInfo, handleLogout }) => {

    const [profile, setProfile] = useState([]);
    console.log(userInfo.data.user_id)
    useEffect(() => {
        const url = '/superadmin/FetchUserProfile';
        axios.get(url)
            .then((res) => {
                setProfile(res.data.data);
                console.log( 'profile ' + res.data.data)
            })
            .catch((err) => {
                console.error('Error fetching data:', err);
            });
    }, []);

    // Update profile
    const [username, setUpdateUname] = useState('');
    const [email_id, setUpdateEmail] = useState('');
    const [phone_no, setUpdatePhone] = useState('');
    const [password, setUpdatePassword] = useState('');
    const [errorMessage, setErrorMessage] = useState('');

    const addProfileUpdate = async (e) => {
        alert(  JSON.stringify({ username, email_id, phone_no, password }), 'add charger all data' );
        e.preventDefault();
        try {
            const userID = parseInt(userInfo.data.user_id);
            const emailID = parseInt(email_id);
            const phoneNo = parseInt(phone_no);
            const Password = parseInt(password);
            const response = await fetch('/superadmin/UpdateUserProfile', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ user_id:userID, username, email_id:emailID, phone_no:phoneNo, password }),
            });
            alert(  JSON.stringify({ user_id:userID, updateUname, email_id, phone_no:phoneNo, password }), 'add charger all data' );
            if (response.ok) {
                alert('Charger added successfully');
                // Clear the input after successful submission if needed
                setUpdateUname(''); 
                setUpdateEmail(''); 
                setUpdatePhone(''); 
                setUpdatePassword(''); 
            } else {
                setErrorMessage('Failed to add charger');
            }
        }catch (error) {
                setErrorMessage('An error occurred while adding the charger');
                console.error('Error:', error);
        }
    };
    // Add Chargers end
    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout}/>
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Profile</h3>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div class="col-md-12 grid-margin stretch-card">
                                            <div class="card">
                                                <div class="card-body">
                                                    <form class="forms-sample" onSubmit={addProfileUpdate}>
                                                        <div class="form-group row">
                                                            <label for="exampleInputUsername2" class="col-sm-2 col-form-label">User Name</label>
                                                            <div class="col-sm-10">
                                                                <input type="text" class="form-control" placeholder="Username" value={updateUname}  onChange={(e) => setUpdateUname(e.target.value)} required/>
                                                            </div>
                                                        </div>
                                                        <div class="form-group row">
                                                            <label for="exampleInputEmail2" class="col-sm-2 col-form-label">Email</label>
                                                            <div class="col-sm-10">
                                                                <input type="email" class="form-control" placeholder="Email" value={updateEmail}  onChange={(e) => setUpdateEmail(e.target.value)} readOnly required/>
                                                            </div>
                                                        </div>
                                                        <div class="form-group row">
                                                            <label for="exampleInputMobile" class="col-sm-2 col-form-label">Phone</label>
                                                            <div class="col-sm-10">
                                                                <input type="text" class="form-control" placeholder="Phone number" pattern="[0-9]{10}" value={updatePhone}  onChange={(e) => setUpdatePhone(e.target.value)} required/>
                                                            </div>
                                                        </div>
                                                        <div class="form-group row">
                                                            <label for="exampleInputPassword2" class="col-sm-2 col-form-label">Password</label>
                                                            <div class="col-sm-10">
                                                                <input type="password" class="form-control" pattern="[0-9]{4}" placeholder="Password" value={updatePassword}  onChange={(e) => setUpdatePassword(e.target.value)} required/>
                                                            </div>
                                                        </div>
                                                        {errorMessage && <div className="text-danger">{errorMessage}</div>}
                                                        <div style={{textAlign:'center'}}>
                                                            <button type="submit" class="btn btn-primary mr-2">Update</button>
                                                        </div>
                                                    </form>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    );
};   

export default Profile
